import React from 'react';
import { PieChart } from 'react-minimal-pie-chart';

// function Pie(props){
function Pie(props){
    const data=[
        { title: '여자', value: props.movie.gender[0].gender_woman, color: '#F88158' },
        // { title: '여자', value: {props.movie_detail.woman}, color: '#F88158' },
        { title: '남자', value: props.movie.gender[0].gender_man, color: '#43C6DB' },
        // { title: '남자', value: parseInt({props.movie_detail.man}), color: '#43C6DB' },
        ];
    return(<PieChart className='PieChart'
        data={data}
        label={({dataEntry})=>dataEntry.value + '%'}
        width
      />)
}

export default Pie
